import React from "react";
import { DefaultSection, SectionTitleCenter, CenteredText } from "../section";
import VisionCard from "../about-us/vision/card";
import styled from "styled-components";
import { VisionImage, MissionImage, ValueImage } from "../about-us/vision/images";

const CardContainer = styled("div")`
display: flex;
flex-direction: row;
justify-content: center;
`;

const contents = [{
    id: "1",
    img: <VisionImage />,
    title: "Greater Contro",
    content: 'Set your own trip terms, create cost centers, and control budget allocation.'
},
{
    id: "2",
    img: <MissionImage />,
    title: "Greater Contro",
    content: 'Set your own trip terms, create cost centers, and control budget allocation.'
},
{
    id: "3",
    img: <ValueImage />,
    title: "Greater Contro",
    content: 'Set your own trip terms, create cost centers, and control budget allocation.'
}
];

const VisionContent = () => {
    return (
        <>
            <DefaultSection>
                <SectionTitleCenter>
                    Our Team
                </SectionTitleCenter>
                <CenteredTextContent>
                    Our company is ran by the best and brightest team in the industy.
                </CenteredTextContent>
                <CardContainer>
                    {contents.map((content) => (

                        <VisionCard key={content.id} content={content} />

                    ))}
                </CardContainer>

            </DefaultSection>
        </>
    );
}

export default VisionContent;
